import React from 'react';
import { Button, Grid, Toolbar, Divider } from '@material-ui/core';
import {withStyles,} from '@material-ui/core/styles';
import InstagramIcon from '@material-ui/icons/Instagram';
import FacebookIcon from '@material-ui/icons/Facebook';
import IconButton from '@material-ui/core/IconButton';
import './Header.css';

const ColorButton = withStyles((theme) => ({
  root: {
    color: "white",
    backgroundColor: "black",
    '&:hover': {
      backgroundColor: "black",
    },
    margin: "10px"
  },
}))(Button);

export default function Header() {
    return (
      <Grid container alignItems="center" justify="center">
        <Grid item xs={12} sm={3} >
            <img src="/images/MathLaw.PNG"></img>
            <InstagramIcon/>
            <FacebookIcon/>
        </Grid>
        <Grid item xs={12} sm={6}>
          <h1 style={{fontSize: "2em"}}>Match Law Student</h1>
        </Grid>
        <Grid item xs={12} sm={3} alignItems="center" justify="flex-end">
          <ColorButton>Sign Up</ColorButton>
          <ColorButton>Log In</ColorButton>
        </Grid>
      </Grid>

    );
}
